import React from "react";
import "../index.css";
import * as firebase from "firebase";
export default class Log extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    this.setState({});
  }

  render() {
    return (
      <div
        style={{
          backgroundColor: "DarkSlateGreen",
          color: "white",
          textAlign: "center",
          margin: "auto",
          width: "60vw",
          height: "60vw",
        }}
      >
        <h1>Training Log</h1>
        <hr />
        <h3>This page is under development. </h3>
      </div>
    );
  }
}
